import Button from 'react-bootstrap/Button';


interface ButtonProps {
  text: string;
}

const FancyButton = ({...props}:ButtonProps) => {
	return (
		<div>
			<Button variant="primary">{props.text}</Button>
		</div>
	);
}

export default FancyButton
